sys_variable_value.value:
(function execute(inputs, outputs) {

  var envelope = {
    message: inputs.message,
    signature: inputs.signature
  }

  outputs.envelope = gs.base64Encode(JSON.stringify(envelope))

})(inputs, outputs);

